import styled from 'styled-components'

export const Bar = styled.div`

width: 300px;
height: 60px;
background-color: white;
position: fixed;
bottom: 15px;
display: flex;
justify-content: space-around;
align-items: center;
border-radius: 3%;


img{
    width: 90%;
    cursor: pointer;
}

`
